import './Home.css';

function Home() {
  return (
    <div className="Home">
      <header className="Home-header">
        <img src="GamersLogo.png" className="Gamers-logo" alt="logo"/>
        <p>
          Hi
        </p>
        <a>
          Hello.
        </a>
      </header>
    </div>
  );
}
